import React, { Component } from 'react'

//Rutas a paginas
import Navbar from '../Navbar/Navbar';

export default class Profile extends Component {
  render() {
    return (
      <div>
        <Navbar conditions={'home'}/>
        Hi there,
      </div>
    )
  }
}
